import {Link, useParams, NavLink} from 'react-router-dom'
function EventPages(){
    const dummy_events = [
        {id: 1, title: "Gekyume's circumcission festival"},
        {id: 2, title: "Johnny' cocaine blowout"},
        {id: 3, title: "Gertrude's birthday party"}
    ]
    return(
        <div>
            <p>EventPages</p>
            <p><Link to="new">Create Event</Link></p>
            <ul>
            {
                dummy_events.map((event)=><li key ={event.id}><NavLink to={`${event.id}`}>{`${event.title}`}</NavLink></li>)
            }
            </ul>
            <p><Link to="..">Back</Link></p>
        </div>
    )
    }
    export default EventPages
